<p>发布/订阅模式（Publish-Subscribe Model）是 RabbitMQ 中常见的消息模式之一，它允许多个消费者接收同一个消息，每个消费者都会获得该消息的副本。在这种模式下，生产者只需将消息发送到交换机，由交换机将消息传递给所有订阅了该交换机的队列。因此，这种模式也被称为广播模式。</p>
